import React, { useEffect } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { getGoals } from '../features/task/taskSlice'
const Navbar = () => {
const dispatch = useDispatch()
    const { goals } = useSelector(state => state.task)
    useEffect(() => {
        dispatch(getGoals())
    },[])
    return (
    <div className='flex justify-center items-center'>
            
      <div className='flex justify-center items-center space-x-4 text-2xl bg-[gray]/20 p-3 rounded w-1/3'>
                <a href="#" className='hover:underline'>Tasks</a>
          <a href="#">Users</a>
          <a href="#">Add New User</a>

    </div>
    </div>
  )
}

export default Navbar
